import './new.scss';

interface NewProps {
    classNameAdded: string;
}

const New = ({classNameAdded = ''}: NewProps): JSX.Element => {
    return (
        <div className={`newService ${classNameAdded}`}>
            <div className="newService__textWrapper">
                <h2>App development</h2>
                <span>Is a hybrid solution better then a native solution for your organisation? We can help you with building an App suited for your goals.</span> 
            </div>
        </div>
    );
}

export default New;
